static const uint8_t JMRIB[] = {
    8,
    0xAD,0xAD,0xFF,0x1B,0xB5,0xBC,0x21,0xBB
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMRIData(char *Buffer)
{
    memcpy(Buffer, &JMRIL0[1], JMRIL0[0] << 2);
    Buffer += (JMRIL0[0] << 2);

    memcpy(Buffer, &JMRIL1[1], JMRIL1[0] << 2);
    Buffer += (JMRIL1[0] << 2);

    memcpy(Buffer, &JMRIL2[1], JMRIL2[0] << 2);
    Buffer += (JMRIL2[0] << 2);

    memcpy(Buffer, &JMRIL3[1], JMRIL3[0] << 2);
    Buffer += (JMRIL3[0] << 2);

    memcpy(Buffer, &JMRIL4[1], JMRIL4[0] << 2);
    Buffer += (JMRIL4[0] << 2);

    memcpy(Buffer, &JMRIL5[1], JMRIL5[0] << 2);
    Buffer += (JMRIL5[0] << 2);

    memcpy(Buffer, &JMRIB[1], JMRIB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMRIName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMRIData(void)
{
    remove(JMRIName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMRIData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMRIName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMRIName)) return "";
    #endif

    if (!(han = fopen(JMRIName, "wb"))) return "";
    if (AutoClean) atexit(KillJMRIData);

    num = fwrite(&JMRIL0[1], 4, JMRIL0[0], han);
    if (num != JMRIL0[0]) {fclose(han); return "";}

    num = fwrite(&JMRIL1[1], 4, JMRIL1[0], han);
    if (num != JMRIL1[0]) {fclose(han); return "";}

    num = fwrite(&JMRIL2[1], 4, JMRIL2[0], han);
    if (num != JMRIL2[0]) {fclose(han); return "";}

    num = fwrite(&JMRIL3[1], 4, JMRIL3[0], han);
    if (num != JMRIL3[0]) {fclose(han); return "";}

    num = fwrite(&JMRIL4[1], 4, JMRIL4[0], han);
    if (num != JMRIL4[0]) {fclose(han); return "";}

    num = fwrite(&JMRIL5[1], 4, JMRIL5[0], han);
    if (num != JMRIL5[0]) {fclose(han); return "";}

    num = fwrite(&JMRIB[1], 1, JMRIB[0], han);
    if (num != JMRIB[0]) {fclose(han); return "";}

    fclose(han);
    return JMRIName;
}

